	curStruct['nextList'] = getNextList(curBytes)
	G[cur] = curStruct

	for e in curStruct['nextList']:
		nextBytes = jIS40A[e['v']]
		nextBytes = decrypt(nextBytes, e['key'])
		buildG(e['v'], nextBytes)

