import queue

def dij(s, t):
	dis = [0x3f3f3f3f for i in range(1000)]
	done = [0 for i in range(1000)]
	path = [-1 for i in range(1000)]
	pathId = [-1 for i in range(1000)]

	dis[s] = 0
	que = queue.PriorityQueue()
	que.put([0, s])
	while not que.empty():
		[cdis, cur] = que.get()
		if done[cur] != 0:
			continue
		done[cur] = 1
		if cur == t:
			break
		for e in G[cur]['nextList']:
			if dis[e['v']] > cdis + 1:
				dis[e['v']] = cdis + 1
				path[e['v']] = cur
				pathId[e['v']] = e['id']
				que.put([dis[e['v']], e['v']])
	validInput = []
	cur = t
	while cur != s:
		c = pathId[cur]
		validInput.append(chr(ord('a') + c))
		cur = path[cur]
	validInput.reverse()
	return validInput

